import React from 'react';
import { TextField } from '@material-ui/core';
import { Button } from '@material-ui/core';


const Title1 = {
  fontSize: '20px',
  color: '#008037',
  fontWeight: 'bold',
  marginLeft: '20px',
  justifyContent: 'center'
}
const Field = {
  marginLeft: '20px',
  width: '500px',
  marginTop: '25px',
  padding :'15px',
 

}
const buttonstyle = {
  marginLeft: '150px',
  marginTop: '50px',
  backgroundColor: '#008037' ,
  width: '80px',
  borderRadius: '5px'
  
 
 
}

const BasketsUpdate = () => {
  return (
    <div >
      <div style={Title1}>
        <h2> Enter new Fields</h2>
      </div>
      <div style={Field}>
        <TextField 
          label="Enter name" />
         
        <TextField style={{marginLeft: '50px'}}
          label="Enter PriceBeforeDis" />
        
      </div >
     
      <div style={Field}>
        <TextField
          label="Enter PriceAfterDiscount" />
      </div>
      <div style={Field}>
        <TextField
          label="Enter Discount" />
      
        <TextField style={{marginLeft: '50px'}}
          label="Enter Description" />
           
        <TextField style={{marginLeft: '50px'}}
          label="Enter restaurant_id" />
      </div>
    
     
     
      <div style={buttonstyle}>
        <Button variant="outline-success">Valider</Button>
        </div>

    </div>

  )

};

export default BasketsUpdate;
